import React from 'react'
import Question from './Question'

export default function Subject() {
  return (
    <form>
     <Question 
     qno='Q.1-)' 
     quest='5+6=?'
     optA='56'
     optB='58'
     optC='65'
     optD='11'
     corrtans='D'



     />
         <Question 
     qno='Q.2-)' 
     quest='6+6=?'
     optA='5'
     optB='8'
     optC='12'
     optD='11'
     corrtans='C'



     />
     <br></br> <br></br>
     <button type='submit'>Submit Question</button>
    </form>

   
  )
}
export function Java(){
    return (
        <div>Java Content</div>
    )
}
export function Sql(){
    return (
        <div>Sql Content</div>
    )
}
export function Html(){
    return (
        <div>Html Content</div>
    )
}
